                id="navbarDropdown"
                role="button"
                data-toggle="dropdown"
                aria-haspopup="true"
                aria-expanded="false"
                style={{ color: "black" }}
              >
               <span style={{ color: `${col}` }}>
                  <i class="fas fa-ellipsis-h"></i>
                </span>
                {/* <ModalPage /> */}
              </Link>
